def count_nice_strings(S: str, MOD: int=10 ** 9 + 7) -> int:

    def primes(n: int) -> list:
        P = []
        U = [1] * (n + 1)
        p = 2
        while p <= n:
            if U[p]:
                P.append(p)
                x = p
                while x <= n:
                    U[x] = 0
                    x += p
            p += 1
        return P
    X = [ord(c) - ord('a') for c in S]
    P = primes(10000)
    L = defaultdict(int)
    s = 0
    for i in range(len(S)):
        p = i in P
        NL = defaultdict(int)
        for a in range(26):
            for l in L:
                NL[l + a * p] += L[l]
        for a in range(X[i]):
            NL[s + a * p] += 1
        s += X[i] * p
        L = NL
    L[s] -= 1
    r = 0
    for p in P:
        r += L[p]
    return r % MOD

